import React from 'react';
import classes from './Dialogs.module.css';
import { NavLink } from 'react-router-dom';

const DialogItem = (props) =>
{
    return(
    <NavLink className={classes.item} activeClassName={classes.active} to={'/dialogs/'+props.id}>{props.name}</NavLink>
    )
}

const Message = (props) => {
    return(
        <div>{props.message}</div>
    )
}

let DialogsData = [
    {id: 1, name: 'Sasha'},
    {id: 2, name: 'Polina'},
    {id: 3, name: 'Mark'},
    {id: 4, name: 'Pavel'},
    {id: 5, name: 'Bill'},
]

let MessageData = [
    {id: 1, message: 'Hi'},
    {id: 2, message: 'How are you?'},
    {id: 3, message: 'Yo'},
    {id: 4, message: 'Pavel'},
    {id: 5, message: 'Bill'},
]
let dialogElement = DialogsData.map (dialog => <DialogsData name={DialogsData.name} id={DialogsData.id} />);

const Dialogs = (props) => {
return(
    <div className={classes.dialogs}>
        <div className={classes.dialogs.item}>
            <b>



</b>
        </div>
        <div>
  <Message message={MessageData[0].message} />
  <Message message={MessageData[1].message} />
  <Message message={MessageData[2].message} />
  </div>
    </div>

)
}

export default Dialogs;
